def homework_4(Str): # 請同學記得把檔案名稱改成自己的學號(ex.1104813.py)

    if len(Str)<1000:  #如果Str長度小於1000(遞迴能觸裡的範圍)
        if len(Str)<2: #如果Str的長度小於2了，把boolen設為True(有兩種情況，【1.原本長度只有1】，【2.後面回傳的Str剩下不到2的長度】)
            return True #回傳True
        if Str[0]!=Str[-1]:  #如果Str裡第一個字和最後一個字不一樣
            return False  #回傳False

        return homework_4(Str[1:-1])   #就回傳忽略比較過的第一個字和最後一個字的Str
        
    elif 1000<len(Str)<10000: #如果Str的長度大於1000(遞迴無法處裡的範圍)
        half_Str=len(Str)//2   #設一個half變數存Str一半的長度
        Rever_Str=Str[::-1]  #設一個Rever存Str反轉

        if Str[0:half_Str]==Rever_Str[0:half_Str]:  #如果Str前半等於Str後半的反轉
            return True
        else:   #Str前半不等於Str後半的反轉
            return False

                    
        





